Français;:
ProTeus 2 tire parti de la nouvelle technologie que nous développons qui ajoute diverses zones et zones dans un monde.

Nous avons doublé la quantité de textures du monde, rendu des millions de lames d'herbe et peuplé d'innombrables nouveaux foliaires extraterrestres - chacun donnant diverses ressources.
;

Tout ce que vous observez sur vos aventures peut maintenant être découvert. Bien plus qu'une simple réalisation, le système de découverte déverrouille en fait toutes les ressources différentes de toute ressource trouvée.

Essentiellement, chaque arme ou outil utilisé sur une ressource peut générer un élément différent, permettant une exploration beaucoup plus scientifique du système solaire et de toutes ses formes de vie.
;

Les minéraux peuvent maintenant être filtrés sur votre GPS mis à jour. Cet outil très pratique, qui est maintenant toujours disponible dans votre HUD et n'est plus attaché à votre localisateur, lit depuis vos satellites environnants et votre propre radar de costume interne pour créer des rayons de détection.

Ce système vous montrera tous les minéraux environnants, leur dureté et leur densité, afin que vous puissiez trouver ce que vous recherchez dans vos missions d'artisanat.
;

