1-1. L'environnement physique joue un rôle crucial dans la survie. La température, les systèmes météorologiques, les terrains et les formes de vie autochtones ont toutes une influence directe sur la santé et la durabilité. Être au courant de ces éléments et l'effet qu'ils ont de la plus haute importance.

1-2. Les mesures préventives, la reconnaissance précoce et le traitement rapide contribuent à minimiser la probabilité de diminuer la fonctionnalité et la mort éventuelle. En bref, la sensibilisation est la clé.
;

1-5. Le terrain sur des planètes solaires extra-solaires peut être tremblement et doit être parcouru avec soin. Tout faux peut entraîner l'endommagement de votre costume EVA et entraîner une infraction de convivialité, ce qui peut être catastrophique. Il est impéri d'explorer avec une extrême prudence.

1-6. Pente. Lorsque vous essayez de gravir une pente, veillez à regarder votre indicateur d'avertissement de pente. Pour les pentes supérieures à 30 degrés, à une inclinaison ou à une baisse, pose un danger pour votre traversée. Tenter de sauter ou de courir sur ce terrain inégal n'est pas conseillé.

S'accroupement peut être utilisé pour traverser des pistes extrêmes si nécessaire.;

3-1. La qualité de vie dépend en grande partie de la nutrition, de l'hydratation et de la santé générale. Au fil du temps, la condition physique peut se détériorer, affecter la vitesse et la survie. La faim et la soif, si non corrigé, peuvent provoquer une baisse de la santé et de la performance. Les conditions climatiques telles que la chaleur et le froid ont également un effet. Il est impératif de surveiller ces utilisateurs utilisant les lectures de costumes fournies.

3-2. Lorsque la condition physique diminue et la santé est altérée, la guérison est possible en utilisant certains types de nourriture et de bandages. La guérison est cruciale afin de maintenir la vie.
;

7-5. U.n.e. Les agents peuvent se trouver en contact avec d'autres membres du personnel. Dans ces situations, ces personnels peuvent se regrouper en mettant en place une fête ou une colonie.

7-6. Configuration d'une partie: Pour le personnel créant une fête, ils doivent marcher jusqu'à l'autre opération, les regarder, puis appuyer sur [F] pour inviter. Le personnel rejoignant la partie doit ensuite regarder et l'inviter, puis cliquez sur [Accepter] dans le menu.
;

